import React from 'react';
import './AdminPage.css';
import Sidebar from '../Dashboard/Sidebar';
import AdminSidebar from './AdminPageSidebar';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {
    FaTh,
    FaSignOutAlt,
    FaDatabase,
    FaUsers,
    FaCalendar

}from "react-icons/fa";
const menuItem=[
  {
      path:"/Dashboard",
      name:"Dashboard",
      icon:<FaTh/>
  },
  {
      path:"/Dashboard/DonationsData",
      name:"Donations Data",
      icon:<FaDatabase/>
  },
  {
      path:"/Dashboard/UsersData",
      name:"Users Data",
      icon:<FaUsers/>
  },
  {
    path: "/Dashboard/Events",
    name:"Create Events",
    icon: <FaCalendar/>
  },
  {
      path: "/SignInSignUp",
      name: "LogOut",
      icon: <FaSignOutAlt/>
  }
]
function AdminPage() {
  return (
    <div>
        <Sidebar menuItem={menuItem}>
            <h1>Hi</h1>
        </Sidebar>
    </div>
  );
}

export default AdminPage;
